import React, {useCallback} from 'react';
import {useHistory} from 'react-router-dom';
const SetCol1 = (props) => {
    
    const history = useHistory();
    //Checking energy
    if(props.energy < 0){
      console.log("noEnergy")
      
      const noMoreEnergyFunction = useCallback(() => history.push('/SleepAtHome'), [history]);

      props.onAddMinutes(480);
      props.onAddEnergy(100);
      noMoreEnergyFunction();

    } else if(props.energy > 100){
      props.onAddEnergy(100 - props.energy);
    }

    //Checking lust.

    return(
      <>
      <p> Energy: {props.energy.toFixed(1)}  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;   {props.date.toString().slice(0,21)} &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  Cash: ${props.money}</p>
      </>
    )
  }

export default SetCol1;
